import styled from "styled-components";

export const LinkingWrapper = styled.div `
      ul{
        display :flex;
        justify-content:center;
        align-items:center;
        list-style-type:none;
      }
      li{
         padding:20px;
         position : relative;
         font-weight: bold;
         font-size: 24px;
      }
      a{
        text-decoration:none;
        color:black;
      }

`
